import React from 'react'
import { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles(() => ({    // this group of buttons will be aligned to the right side
    navBar:{
        text:'white'
    },
}));

const TopNav = () => {
    const classes = useStyles();
    return (
        <nav className="navbar navbar-expand-lg navbar-light" className={classes.navBar}>
            <a className="navbar-brand" href="#">Aman Shrestha</a>
            <button className="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
                <span className="navbar-toggler-icon"></span>
            </button>

            <div className="collapse navbar-collapse" id="navbarSupportedContent">
                <ul className="navbar-nav mr-auto">
                </ul>
                <ul className="navbar-nav ml-auto">
                    <li className="nav-item active">
                        <a className="nav-link" href="#">Resume</a>
                    </li>
                    <li className="nav-item active">
                        <a className="nav-link" href="#">Contact</a>
                    </li>
                </ul>
            </div>
        </nav>
    )
}

export default TopNav
